import AxiosService from "./AxiosService";
var apiBase = process.env.BACKEND_URL;

const getByName = (searchText) => {
  return AxiosService.get(apiBase + "/stops/" + searchText);
};
const getAll = () => {
  return AxiosService.get(apiBase + "/stops");
};

const getDepartures = (stopId) => {
  return AxiosService.get(apiBase + "/departures/" + stopId);
};

export default {
  getAll,
  getByName,
  getDepartures,
};
